import React from "react"
import "./fundoPreto.css"

const Home = (props) => {
    const { name } = props
    return (
        <button className="fundoPreto fundoPretoMenor">{name}</button>
    )
}

const Following = (props) => {
    const { name } = props
    return (
        <button className="fundoPreto">{name}</button>
    )
}

const Search = ({ placeholder }) => {
    // const { placeholder } = props
    return (
        <input className="search" placeholder={placeholder}></input>
    )
}

export default Home
export {Following}
export {Search}
